import React,{useState,useEffect} from"react"
import axios from "axios";
import { useParams } from 'react-router-dom';

export default function VehicleDetail(){

    const{id}=useParams();

    const [vehicle, setVehicles] = useState([]);

    const getVehicle = () => {
        axios.get('http://localhost:6060/Vehicle/get/'+id)
        .then((res) => {
            console.log(res.data);
            setVehicles(res.data);
        })
        .catch((err) => {
            alert(err.message);
        });    
        
    };

    

    useEffect(() => {
        getVehicle();
        
    }, []);

    return(

        <div>

                <div class="vehicle-cards">
                <div class="vehicle-card">
                {vehicle.map((v, index) => (  
                    <div class="vehicle-details">
                    <h3>{v.regnumber}</h3>   
                    <p>Brand:{v.brand}</p>
                    <p>Model:{v.model}</p>
                    <p>Year:{v.year}</p>
                    <p>Type:{v.type}</p>
                    <p>Fuel:{v.fueltype}</p>
                    <p>Price/Day:{v.priceperday}</p>
                    <p>Transmission:{v.regnumber}</p>
                    <p>Available:{v.available}</p>
                    <p>{id}</p>
                    </div>
                    ))} 
                </div>
                
                </div>
                {vehicle.map((v, index) => (
                <div class="vehicle-image">
                    <img src={v.image} alt="Vehicl" />
                    </div>
                ))} 
                   



        </div>
    )
}
